import React from 'react';
import { Instagram, Twitter, Youtube, Calendar, Mail } from 'lucide-react';
import './HomePage.css';

const HomePage = () => {
    const links = [
        {
            title: "Instagram",
            subtitle: "Follow for daily comedy content",
            icon: <Instagram size={24} />,
            href: "https://instagram.com/onkaryadav",
            color: "#E4405F"
        },
        {
            title: "YouTube",
            subtitle: "Watch full comedy performances",
            icon: <Youtube size={24} />,
            href: "https://www.youtube.com/@boi_onkar",
            color: "#FF0000"
        },
        {
            title: "Twitter",
            subtitle: "Quick jokes & updates",
            icon: <Twitter size={24} />,
            href: "https://twitter.com/onkaryadav",
            color: "#1DA1F2"
        },
        {
            title: "Book a Show",
            subtitle: "Corporate events & private parties",
            icon: <Calendar size={24} />,
            href: "mailto:bookings@onkaryadav.com",
            color: "#28a745"
        },
        {
            title: "Contact",
            subtitle: "Get in touch for collaborations",
            icon: <Mail size={24} />,
            href: "mailto:info@onkaryadav.com",
            color: "#667eea"
        }
    ];

    return (
        <div className="homepage">
            <div className="container">
                {/* Profile Section */}
                <div className="profile-section">
                    <div className="profile-image">
                        <img
                            src="https://images.unsplash.com/photo-1507003211169-0a1dd7228f2d?w=200&h=200&fit=crop&crop=face"
                            alt="Onkar Yadav"
                            onError={(e) => {
                                e.target.src = "https://via.placeholder.com/200x200/333/fff?text=OY";
                            }}
                        />
                    </div>
                </div>

                {/* Links Section */}
                <div className="links-section">
                    {links.map((link) => (
                        <a
                            key={link.title}
                            href={link.href}
                            className="link-card"
                            target="_blank"
                            rel="noopener noreferrer"
                        >
                            <div className="link-icon" style={{ color: link.color }}>
                                {link.icon}
                            </div>
                            <div className="link-content">
                                <h3>{link.title}</h3>
                                <p>{link.subtitle}</p>
                            </div>
                        </a>
                    ))}
                </div>

                {/* Footer */}
                <div className="footer">
                    <p>&copy; 2024 Onkar Yadav. All rights reserved.</p>
                </div>
            </div>
        </div>
    );
};

export default HomePage;
